import React from "react";

export default function Home() {
  return (
    <div className="card">
      <h3>Welcome</h3>
      <p>
        Short welcome text. Use the navigation above to visit About, Contact (controlled form), Feedback (uncontrolled form), or Account pages.
      </p>
    </div>
  );
}
